import React from 'react';
import { Link } from 'react-router-dom';
import { Button, makeStyles } from '@material-ui/core';
import pokedex from '../img/Pokédex_logo.png';

const useStyles = makeStyles((theme) => ({
    root: {
        height: 1000,
    }
}))

const Home = () => {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <img src={pokedex} alt='pokedex logo'/>
            TO GO TO THE POKEDEX CLICK HERE<br></br>
            <Button component={Link} to="/pokemons">POKEDEX</Button><br></br>
            TO GET MORE IN-DEPTH INFORMARTION ABOUT A SPECIFIC POKEMON, JUST CLICK IT!
        </div>
    );
};

export default Home;
